from functools import cache
import sys

class Solution:
    def jobScheduling(self, startTime, endTime, profit):
        sys.setrecursionlimit(150000)
        jobList = sorted(zip(startTime, endTime, profit))
        n = len(jobList)

        def helper(end):
            low, high = 0, n-1
            while low <= high:
                mid = (low + high) // 2
                if jobList[mid][0] < end:
                    low = mid + 1
                else:
                    high = mid - 1
            return low

        @cache
        def jobSchedulingRecurs(index) -> int:
            profits = 0
            if index >= n:
                return 0

            nextIndex = helper(jobList[index][1])

            profits += max(
                jobList[index][2] + jobSchedulingRecurs(nextIndex),
                jobSchedulingRecurs(index + 1)
            )
            
            return profits
        
        return jobSchedulingRecurs(0)

